import styled from "styled-components";
import React from "react";

const Line = styled.div`
    height: 3px;
    width: 30px;
    background-color: white;
    margin-top: 6px;
`;
const Burg = styled.div`
    position: absolute;
    top: 13%;
    right: 3%;
    &:hover {
        * {
            box-shadow: 0px 0px 4px rgba(255, 255, 255, 0, 25);
        }
    }
`;
const Burger = () => {
    return (
        <Burg>
            <Line />
            <Line />
            <Line />
        </Burg>
    );
};

export default Burger;
